// src/components/Dashboard.js
import React from 'react';
import { useHistory } from 'react-router-dom';

const Dashboard = () => {
    const history = useHistory();

    return (
        <div className="dashboard">
            <h1>Welcome to Side by Side! Do share how you are feeling with the community.</h1>
            <p>Chances are they have been through it too - and they might be able to help.</p>
            <div className="dashboard-buttons">
                <button onClick={() => history.push('/moodtracker')}>Mood Tracker</button>
                <button onClick={() => history.push('/resources')}>Resources</button>
                <button onClick={() => history.push('/circles')}>Circles</button>
            </div>
        </div>
    );
};

export default Dashboard;
